[{'comment_id': 950719411, 'comment_body': 'Why the spaces were removed? Ditto below.', 'comment_created': datetime.datetime(2022, 8, 20, 17, 22, 18, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950722537, 'comment_body': 'Why we are checking for the visiblity of here?', 'comment_created': datetime.datetime(2022, 8, 20, 17, 42, 4, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950722730, 'comment_body': 'I know you used it previously to select an option element. Bu does options appear in this case. Also, I think we are giving input [here ](https://github.com/oppia/oppia/blob/develop/core/tests/protractor_utils/AdminPage.js#L237)and not selecting any option.', 'comment_created': datetime.datetime(2022, 8, 20, 17, 44, 36, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950722838, 'comment_body': '[This](https://github.com/oppia/oppia/blob/develop/core/tests/protractor_utils/AdminPage.js#L275) seems to be missing.', 'comment_created': datetime.datetime(2022, 8, 20, 17, 45, 41, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950723244, 'comment_body': 'Why *?', 'comment_created': datetime.datetime(2022, 8, 20, 17, 50, 16, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950723367, 'comment_body': 'Why are you using ` nodeStateElement` in replace of `nodeElement` above?', 'comment_created': datetime.datetime(2022, 8, 20, 17, 52, 2, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950723411, 'comment_body': 'Why? This might need a comment too above.', 'comment_created': datetime.datetime(2022, 8, 20, 17, 52, 18, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950723560, 'comment_body': 'Why are you using presence of keeping in mind that earlier visibility was checked?', 'comment_created': datetime.datetime(2022, 8, 20, 17, 54, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950724386, 'comment_body': "`(await explorationObjectiveWarning.getCSSProperty('color')).value` returns color value without spaces unlike protractor. So we need to remove expect color values without spaces only.", 'comment_created': datetime.datetime(2022, 8, 20, 18, 2, 57, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950724728, 'comment_body': 'Previously we were clicking on the option itself to select, and we were using `action.click()` for that, which actually waits for the element to be visible first. So here also i am firstly waiting for the element to be visible before we can call `selectByVisibleText` on it.', 'comment_created': datetime.datetime(2022, 8, 20, 18, 6, 32, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950724861, 'comment_body': 'The element we are dealing with here is a dropdown. So we need to use `selectByVisibleText` instead of setValue. In protractor sendKeys can work on dropdown but not in webdriverio.', 'comment_created': datetime.datetime(2022, 8, 20, 18, 8, 27, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950725261, 'comment_body': "The link you are pointing to is from `enableFeatureForProd` function but here we have `enableFeatureForDev` function. And in this function we do not have sendKeys beacause by default the value of dropdown is always 'dev'.", 'comment_created': datetime.datetime(2022, 8, 20, 18, 12, 23, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950725369, 'comment_body': 'Here * is needed because the stateName is not the complete text present inside the e2e-test-node element. And for partial text we use `*=`', 'comment_created': datetime.datetime(2022, 8, 20, 18, 13, 40, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950725546, 'comment_body': 'Reverted.', 'comment_created': datetime.datetime(2022, 8, 20, 18, 15, 58, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950725936, 'comment_body': ' We need to use browser.pause() in order to wait for the state name container to disappear as webdriverio checks for its presence even before it disappears.', 'comment_created': datetime.datetime(2022, 8, 20, 18, 20, 21, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950725981, 'comment_body': 'Reverted.', 'comment_created': datetime.datetime(2022, 8, 20, 18, 20, 40, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 950870675, 'comment_body': 'Why getValue?', 'comment_created': datetime.datetime(2022, 8, 21, 16, 30, 41, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950871554, 'comment_body': 'Why is this added?', 'comment_created': datetime.datetime(2022, 8, 21, 16, 38, 11, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950872112, 'comment_body': 'I am wondering can we not design a function in action.js for `selectByVisibleText` as we have for [select ](https://github.com/oppia/oppia/blob/develop/core/tests/protractor_utils/action.js#L66)?', 'comment_created': datetime.datetime(2022, 8, 21, 16, 42, 55, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950872376, 'comment_body': 'Why?', 'comment_created': datetime.datetime(2022, 8, 21, 16, 45, 12, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950872668, 'comment_body': 'Why these modifications? Can you please brief about these a bit?', 'comment_created': datetime.datetime(2022, 8, 21, 16, 47, 26, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 950872726, 'comment_body': 'Why removed?', 'comment_created': datetime.datetime(2022, 8, 21, 16, 48, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 951719979, 'comment_body': 'Extra line', 'comment_created': datetime.datetime(2022, 8, 22, 17, 38, 7, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 951720765, 'comment_body': 'Why `visible` --> `present`?', 'comment_created': datetime.datetime(2022, 8, 22, 17, 38, 55, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 951728136, 'comment_body': 'Can we not design a function for it in action.js?', 'comment_created': datetime.datetime(2022, 8, 22, 17, 46, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 951737357, 'comment_body': "What's this comment for?", 'comment_created': datetime.datetime(2022, 8, 22, 17, 54, 58, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 951738165, 'comment_body': "I was wondering what's the logic behind using 2000ms.", 'comment_created': datetime.datetime(2022, 8, 22, 17, 55, 41, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 951741314, 'comment_body': '```suggestion
    // Wait for the appearing and disappearing action to get completed after the main tab button is clicked.
    // further.
```', 'comment_created': datetime.datetime(2022, 8, 22, 17, 58, 42, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 952793648, 'comment_body': 'getValue is the function used to get the values from `<select>, <textarea>, <input>` and we have select here, that why we are using getValue. PTAL [here](https://webdriver.io/docs/api/element/getValue/) for more info', 'comment_created': datetime.datetime(2022, 8, 23, 15, 41, 14, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952797627, 'comment_body': 'It was already present in LibraryPage.js, I forgot to add this before.', 'comment_created': datetime.datetime(2022, 8, 23, 15, 44, 16, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952802786, 'comment_body': 'We already have [select](https://github.com/oppia/oppia/blob/develop/core/tests/webdriverio_utils/action.js#L64) function present in action.js which does the same thing. But as in protractor code also we are not using select function from action file, I am doing the same in webdriverio as well.', 'comment_created': datetime.datetime(2022, 8, 23, 15, 48, 20, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952805374, 'comment_body': 'It takes some time for the all the option to be visible (loading takes some time). So we need to wait till all the options are present.', 'comment_created': datetime.datetime(2022, 8, 23, 15, 50, 24, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952828645, 'comment_body': "The Id's are alloted dynamically to the cke buttons, after the changes in the PR, the id of concept was updated to cke_118 instead of cke_124 causing the tests to [fail](https://github.com/oppia/oppia/runs/7892281673?check_suite_focus=true). So instead of any such id I am now using a user defined class, which will not cause any such failure in future.", 'comment_created': datetime.datetime(2022, 8, 23, 16, 8, 6, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952832222, 'comment_body': "Int the above line we are checking the visibility of 'topicsListItem' which is same as topicsListItems[0], so I just removed the uneeded one.", 'comment_created': datetime.datetime(2022, 8, 23, 16, 10, 48, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952832660, 'comment_body': 'Removed', 'comment_created': datetime.datetime(2022, 8, 23, 16, 11, 9, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952833381, 'comment_body': 'Reverted.', 'comment_created': datetime.datetime(2022, 8, 23, 16, 11, 44, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952834211, 'comment_body': 'Removed.', 'comment_created': datetime.datetime(2022, 8, 23, 16, 12, 26, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952835957, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 8, 23, 16, 13, 47, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 952838219, 'comment_body': "It the max time needed for the disapperance of state container. I tried 1000ms as well but that doesn't worked.", 'comment_created': datetime.datetime(2022, 8, 23, 16, 15, 40, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 954806343, 'comment_body': 'Do we need this keeping in mind that we are using selenium standalone?', 'comment_created': datetime.datetime(2022, 8, 25, 10, 43, 50, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954830762, 'comment_body': 'I just had one question for `browser.keys` and that is how it is determining which is the active element?', 'comment_created': datetime.datetime(2022, 8, 25, 11, 12, 25, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954831561, 'comment_body': 'Can you please explain the use case of this? Ditto elsewhere.', 'comment_created': datetime.datetime(2022, 8, 25, 11, 13, 25, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954850364, 'comment_body': 'Can we not use getAttribute then?', 'comment_created': datetime.datetime(2022, 8, 25, 11, 28, 47, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954851588, 'comment_body': "Why it didn't throw an error then?", 'comment_created': datetime.datetime(2022, 8, 25, 11, 30, 18, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954853585, 'comment_body': 'Do you know why the tests never failed in protractor due to this reason?', 'comment_created': datetime.datetime(2022, 8, 25, 11, 32, 55, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954854318, 'comment_body': '@U8NWXD Do you know why in protractor code we are not using select function from action file?', 'comment_created': datetime.datetime(2022, 8, 25, 11, 34, 29, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954861310, 'comment_body': 'Can we not wait for the visibility of something then? I doubt whether this function will be used again or not ahead.', 'comment_created': datetime.datetime(2022, 8, 25, 11, 42, 36, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 954867019, 'comment_body': "No, getAttribute is not working. The reason is, there is no such attribute `value` present in those element. I don't know how it used to work for protractor, but it doesn't work in wbedriverio.", 'comment_created': datetime.datetime(2022, 8, 25, 11, 48, 58, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 954868826, 'comment_body': 'In protractor we were not using ID, instead we were using chain selectors which was not working with the webdriverio (we discussed this in meet), so I used the specific ID present. ', 'comment_created': datetime.datetime(2022, 8, 25, 11, 50, 56, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 954869311, 'comment_body': 'removed.', 'comment_created': datetime.datetime(2022, 8, 25, 11, 51, 32, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 954872288, 'comment_body': 'We are not giving input here, instead we are testing the keyboard shortcuts. It means we are just pressing the keyboard shortcuts and then verifying that the correct element is being selected.', 'comment_created': datetime.datetime(2022, 8, 25, 11, 54, 50, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 954877013, 'comment_body': 'In protractor to test whether the correct element is focused or not we compare the classnames of both the element to be checked and the active element. But in webdriverio we have a function `isFocused` which returns true if the element is focused else it returns true. So it is more convenient way to check.', 'comment_created': datetime.datetime(2022, 8, 25, 12, 0, 7, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 954879600, 'comment_body': 'As all the options have the same classname we cannot have any other way to wait for their visibility. Also I guess there are some functions present in waitFor which are used only once. So this is not an issue if it is not used anywhere else.', 'comment_created': datetime.datetime(2022, 8, 25, 12, 2, 59, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 956605149, 'comment_body': "I got another idea for this which might reduce a bit of duplicacy. That is to use this in [noOfElements](https://github.com/oppia/oppia/blob/develop/core/tests/webdriverio_utils/waitFor.js#L194) only by taking 4 parameters(parentSelector, childSelector, elementName, number) in noOfElements and setting childSelector to be null intially in the parameter itself. Now if the child selector has a value not equal to null then you can use the logic of chained selectors else use the logic of single selectors.

The reason I am telling this because `numberOfChainedElementsToBe` doesn't seem to express the meaning of this function. Also, as discussed in our prev meeting we couldn't come to a better name too.", 'comment_created': datetime.datetime(2022, 8, 27, 17, 24, 54, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 956667627, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 8, 28, 6, 3, 7, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 957603386, 'comment_body': '```suggestion
      var element = childSelector?await $(elementSelector).$$(childSelector):await $$(elementSelector);
```', 'comment_created': datetime.datetime(2022, 8, 29, 17, 18, 7, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 958092218, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 8, 30, 7, 15, 32, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}]

[{'comment_id': 961951541, 'comment_body': 'What does this do?', 'comment_created': datetime.datetime(2022, 9, 2, 19, 24, 50, tzinfo=datetime.timezone.utc), 'commenter': 'U8NWXD', 'type': 'User'}, {'comment_id': 961952340, 'comment_body': 'Is this just something we forgot to remove from earlier?', 'comment_created': datetime.datetime(2022, 9, 2, 19, 26, 16, tzinfo=datetime.timezone.utc), 'commenter': 'U8NWXD', 'type': 'User'}, {'comment_id': 962103071, 'comment_body': "Yes, learner is present in 'SUITE_MIGRATED_TO_WEBDRIVERIO'  but I forgot to remove this from 'SUITES_STILL_IN_PROTRACTOR'.
It was still working fine because while running the test we generally check whether the requested suite is present in webdriverio first. ", 'comment_created': datetime.datetime(2022, 9, 3, 4, 43, 5, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 962103294, 'comment_body': "Generally `browser.getLogs('browser')` in webdriverio only returns the warnings and error present in console while in protractor it returns everything present in console. It is fine for every other suite as there we only need to checks the errors but in `embedding` suite we need to get all the text present inside console and to do that we need to add these lines in the wdio.conf.js file.", 'comment_created': datetime.datetime(2022, 9, 3, 4, 46, 3, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 962333980, 'comment_body': 'OK in that case, can we make the test stricter to catch these kinds of situations?', 'comment_created': datetime.datetime(2022, 9, 4, 15, 42, 42, tzinfo=datetime.timezone.utc), 'commenter': 'U8NWXD', 'type': 'User'}, {'comment_id': 962341409, 'comment_body': "Yes we can, but as the next migration PR will remove these checks because all the suites will be migrated, so I don't think adding test at this stage is needed now (Also I have confirmed now the list is not containing any duplicates).", 'comment_created': datetime.datetime(2022, 9, 4, 16, 45, 25, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 962806167, 'comment_body': 'Why true?', 'comment_created': datetime.datetime(2022, 9, 5, 11, 34, 1, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 962807025, 'comment_body': 'Why it was shifted here?', 'comment_created': datetime.datetime(2022, 9, 5, 11, 35, 6, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 962807766, 'comment_body': 'This was related to protractor right?', 'comment_created': datetime.datetime(2022, 9, 5, 11, 36, 7, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 962808641, 'comment_body': 'Ditto', 'comment_created': datetime.datetime(2022, 9, 5, 11, 37, 11, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 962809242, 'comment_body': 'Why this check now?', 'comment_created': datetime.datetime(2022, 9, 5, 11, 37, 58, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 962809452, 'comment_body': 'Ditto', 'comment_created': datetime.datetime(2022, 9, 5, 11, 38, 13, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 962811805, 'comment_body': 'Can you please write an explanation here which you explained me in the meeting in order to keep it as a future reference?', 'comment_created': datetime.datetime(2022, 9, 5, 11, 41, 6, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 963019724, 'comment_body': 'OK, sg', 'comment_created': datetime.datetime(2022, 9, 5, 15, 45, 3, tzinfo=datetime.timezone.utc), 'commenter': 'U8NWXD', 'type': 'User'}, {'comment_id': 965806878, 'comment_body': 'This was just for testing purpose, removed now.', 'comment_created': datetime.datetime(2022, 9, 8, 10, 51, 37, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 965808580, 'comment_body': "We cannot use a constructor outside beforeAll, beforeEach, it blockin webdriverio (We discussed this in starting when declaring AdminPage outside 'it' block was throwing error.", 'comment_created': datetime.datetime(2022, 9, 8, 10, 53, 39, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 965811396, 'comment_body': 'In protractor the 0,0 coordinate lie at the top left corner of selected element while in webdriverio it lies at the centre of the selected element so we need to change the coordinates accordingly.', 'comment_created': datetime.datetime(2022, 9, 8, 10, 56, 49, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 965822214, 'comment_body': 'Removed.', 'comment_created': datetime.datetime(2022, 9, 8, 11, 10, 2, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 965822280, 'comment_body': 'Removed.', 'comment_created': datetime.datetime(2022, 9, 8, 11, 10, 6, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 965824769, 'comment_body': 'All the feedback elements take some time to appear, so we need to wait till all the feedback are visible and then proceed further else we are unable to get the feedback elements in further steps.', 'comment_created': datetime.datetime(2022, 9, 8, 11, 12, 55, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 965824908, 'comment_body': 'Same as above.', 'comment_created': datetime.datetime(2022, 9, 8, 11, 13, 4, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 969269502, 'comment_body': 'Why presence of?', 'comment_created': datetime.datetime(2022, 9, 13, 7, 50, 15, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 969270494, 'comment_body': 'Why are you using classnames here?', 'comment_created': datetime.datetime(2022, 9, 13, 7, 51, 14, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 969273094, 'comment_body': 'Why have you modified this?', 'comment_created': datetime.datetime(2022, 9, 13, 7, 53, 55, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 969274028, 'comment_body': 'Why this change?', 'comment_created': datetime.datetime(2022, 9, 13, 7, 54, 46, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 969274784, 'comment_body': 'Ditto', 'comment_created': datetime.datetime(2022, 9, 13, 7, 55, 27, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 969276058, 'comment_body': 'I think this line should also work? So why are you introducing the next two lines? Ditto elsewhere.', 'comment_created': datetime.datetime(2022, 9, 13, 7, 56, 41, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 969277298, 'comment_body': 'Why modifications in these?', 'comment_created': datetime.datetime(2022, 9, 13, 7, 57, 57, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 969280501, 'comment_body': 'Repititive code. Why are you modifying your previous logic which you implemented in your previous migration of the suites?', 'comment_created': datetime.datetime(2022, 9, 13, 8, 1, 4, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970170922, 'comment_body': 'Could you please explain what this line does?', 'comment_created': datetime.datetime(2022, 9, 13, 23, 41, 52, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970172712, 'comment_body': 'I am a bit worried why you have shifted the declaration of lineDivElements and lineContentElements below?', 'comment_created': datetime.datetime(2022, 9, 13, 23, 46, 19, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970173061, 'comment_body': 'Ditto why elementSelector is now a classname?', 'comment_created': datetime.datetime(2022, 9, 13, 23, 47, 8, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970173961, 'comment_body': 'Why chained selectors?', 'comment_created': datetime.datetime(2022, 9, 13, 23, 49, 17, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970175727, 'comment_body': "Why you are now using partial text checker(*) now? I am asking this as earlier you didn't used that?
'", 'comment_created': datetime.datetime(2022, 9, 13, 23, 53, 26, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970176866, 'comment_body': 'Why addValue instead of setValue?', 'comment_created': datetime.datetime(2022, 9, 13, 23, 56, 25, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970186591, 'comment_body': 'Ditto why addValue? I am asking this as you have used setValue earlier.', 'comment_created': datetime.datetime(2022, 9, 14, 0, 21, 26, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 970538139, 'comment_body': 'Replaced with visibiltyOf. Also we need to wait for visibility of because previously we were doing the same while using action.click for selecting the option. ', 'comment_created': datetime.datetime(2022, 9, 14, 9, 12, 34, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970541803, 'comment_body': 'We are using class-name because in `numberOfElementsToBe` we need classname in order to use `$$` again and again till the number of elements are equal to the given number.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 16, 4, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970550290, 'comment_body': "In protractor we are checking whether the elements returned by both selectors are same or not in order to verify it is an active element. But in webdriverio the element selector return an object which consists of a lot more information than just the element id. So it cannot be same even if the elements are same. Like the returned obejct also contains the selectors used for it, but here we can see the element selector are different, means the tests will fail. So a workaround was to check the text inside the active element and verify it is a 'feedback' which verifies feedback button is active element.", 'comment_created': datetime.datetime(2022, 9, 14, 9, 24, 14, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970551741, 'comment_body': 'We do not have any replacement for positionClick, the workaround is to pass coordinates inside click in order to click on a particular position (which is same as moving cursor to a particular position and then clicking).', 'comment_created': datetime.datetime(2022, 9, 14, 9, 25, 34, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970556461, 'comment_body': 'We also do not have any replacement for buttonDown or buttonUp, here the action that we want to perform is move the cursor to `vertexElement1` and then left click and without releasing the button move the cursor to `vertexElement2` and then release the butto and in webdriverio we do the same with just one command `dragAndDrop` so I am using this. `await` is required at line 63 and 64 because without it dragAndDrop will not work (dragAndDrop works only with resolved promise and without using await the element selector returns unresolved promise)', 'comment_created': datetime.datetime(2022, 9, 14, 9, 29, 51, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970558371, 'comment_body': 'No, this line is not working because we vertexElement function is not returning element if we are not using await with it.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 31, 32, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970561820, 'comment_body': 'As setValue clears the element first before adding the text (PTAL [here](https://webdriver.io/docs/api/element/setValue/) ) But we do not need to clear the element here at first so I am using addValue. Also this was not throwing error before, because this code is running only in extension suite which is migrated in this PR.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 34, 35, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970566456, 'comment_body': 'There was error in previous code (I have not used await with `$$`), that why I am modifying this. Also if we will use this at top then $$ is returning undefined because in starting (when this function is called) the element is not present, so in order to get the elment we need to use it before the place where it is used.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 38, 44, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970568089, 'comment_body': 'This line returns the number of line that we have in compareDict, so that we can wait till enough elements are present for comparison purpose.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 40, 8, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970568956, 'comment_body': 'Same reason https://github.com/oppia/oppia/pull/15969/files#r969280501.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 40, 52, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970569531, 'comment_body': 'Same as here https://github.com/oppia/oppia/pull/15969/files#r970561820', 'comment_created': datetime.datetime(2022, 9, 14, 9, 41, 21, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970572447, 'comment_body': 'Element selector will be a classname only in the case when we will have childSelector because at some places we do not have access to the parent class selector and hence we were unable to use this function. So I modified this function so that this function can work in those cases as well.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 43, 47, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970573112, 'comment_body': 'This was an error, in protractor code we have elem but I missed it while migrating.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 44, 23, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970575398, 'comment_body': '`e2e-test-item-selection-input-item` have some other text as well along with desiredAnswer so we need to use partialText checker. Previously this was not throwing any error because this code is used at only one place (in extension test suite) which is migrated in this PR.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 46, 28, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 970575634, 'comment_body': 'Same as above.', 'comment_created': datetime.datetime(2022, 9, 14, 9, 46, 41, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 971868963, 'comment_body': 'So how it was working earlier(not giving an error)?', 'comment_created': datetime.datetime(2022, 9, 15, 11, 31, 19, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 971870209, 'comment_body': 'How about await` action.click(Vertex Element ${i}, await vertexElement(i))`?', 'comment_created': datetime.datetime(2022, 9, 15, 11, 32, 48, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 971874452, 'comment_body': 'Can we not declare it above the if condition then in order to avoid duplicacy?', 'comment_created': datetime.datetime(2022, 9, 15, 11, 37, 39, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 971961523, 'comment_body': 'This code was not used previously, it is used only in the suite migrated in this PR.', 'comment_created': datetime.datetime(2022, 9, 15, 13, 4, 51, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 973149551, 'comment_body': 'Sorry, I am not able to understand this? Can you please explain this in a more verbose way?', 'comment_created': datetime.datetime(2022, 9, 16, 15, 30, 7, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 973157683, 'comment_body': 'I just noticed that there is no error message for this. Can you please add one?', 'comment_created': datetime.datetime(2022, 9, 16, 15, 39, 31, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 973742209, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 9, 18, 16, 3, 24, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 973742379, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 9, 18, 16, 4, 21, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 973742574, 'comment_body': 'Please take a look at line no 203, we have error message present for this.', 'comment_created': datetime.datetime(2022, 9, 18, 16, 5, 29, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}, {'comment_id': 973745168, 'comment_body': "You earlier said that we do not have access to parent class selector, so can we not wait for it's presence?", 'comment_created': datetime.datetime(2022, 9, 18, 16, 25, 37, tzinfo=datetime.timezone.utc), 'commenter': 'SAEb-ai', 'type': 'User'}, {'comment_id': 974232097, 'comment_body': "Take a example like this: 
```
var selector = $('.class-name');
await form.exampleFunction(element);
```
In form.js we have
```
exampleFunction(elem) {
var element2 = await elem.$$('.second-class');
}
```
Now if we want to wait till the number of element2 to be n, then we need to pass the classname of both parent (elem) and children (.second-class) but as we are able to see we do not have access to elem classname (elem is element obtained by calling $ on class name, its not a class name) we need to pass the elem itself with the child class. So in `numberOfElementsToBe` i just replaced $(elementSelector) with elem.

Hope this will make things clear.
", 'comment_created': datetime.datetime(2022, 9, 19, 13, 12, 52, tzinfo=datetime.timezone.utc), 'commenter': 'ShivamJhaa', 'type': 'User'}]
